import './App.css';
import {BrowserRouter,Routers,Route } from 'react-router-dom';
import Navbar from './componets/Navbar/Navbar';
import Shop from './pages/'
function App() {
  return (
    <div>
      <BrowserRouter>
      <Navbar/>
      <Routers>
        <Route path='/' element={<Shop/>}/>
      </Routers>


      </BrowserRouter>


    </div>
  );
}

export default App;
